fields.formula:
concat( 
  if( 
    isblank(field("Deadline")), 
    "YYYYMMDD", 
    datetime_format(field("Deadline"), "YYYYMMDD") 
  ), 
  if( 
    isblank(field("Deadline")), 
    "-", 
    left( 
      upper(field("Name")), 
      1 
    ) 
  ), 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

upper( 
  join( 
    concat( 
      left( 
        regex_replace( 
          field("Show"), 
          "(/|-|:|\s|\t)", 
          "" 
        ), 
        5
      ), 
      year(lookup("Show", "Show start")), 
      "Q", 
      if( 
        and( 
          month(lookup("Show", "Show start")) >= 1, 
          month(lookup("Show", "Show start")) <= 3 
        ), 
        1, 
        if( 
          and( 
            month(lookup("Show", "Show start")) >= 4, 
            month(lookup("Show", "Show start")) <= 6 
          ), 
          2, 
          if( 
            and( 
              month(lookup("Show", "Show start")) >= 7, 
              month(lookup("Show", "Show start")) <= 9 
            ), 
            3, 
            if( 
              and( 
                month(lookup("Show", "Show start")) >= 10, 
                month(lookup("Show", "Show start")) <= 12 
              ), 
              4, 
              0 
            ) 
          ) 
        )
      ), 
      "-", 
      if( 
        row_id() < 10, 
        concat("0000", row_id()), 
        if( 
          row_id() < 100, 
          concat("000", row_id()), 
          if( 
            row_id() < 1000, 
            concat("00", row_id()), 
            if( 
              row_id() < 10000, 
              concat("0", row_id()), 
              row_id() 
            ) 
          ) 
        ) 
      ) 
    ), 
    "" 
  ) 
)

upper( 
  join( 
    concat( 
      left( 
        regex_replace( 
          field("Show"), 
          "(/|-|:|\s|\t)", 
          "" 
        ), 
        5
      ), 
      year(lookup("Show", "Show start")), 
      "Q", 
      if( 
        and( 
          month(lookup("Show", "Show start")) >= 1, 
          month(lookup("Show", "Show start")) <= 3 
        ), 
        1, 
        if( 
          and( 
            month(lookup("Show", "Show start")) >= 4, 
            month(lookup("Show", "Show start")) <= 6 
          ), 
          2, 
          if( 
            and( 
              month(lookup("Show", "Show start")) >= 7, 
              month(lookup("Show", "Show start")) <= 9 
            ), 
            3, 
            if( 
              and( 
                month(lookup("Show", "Show start")) >= 10, 
                month(lookup("Show", "Show start")) <= 12 
              ), 
              4, 
              0 
            ) 
          ) 
        )
      ), 
      "-", 
      if( 
        row_id() < 10, 
        concat("00", row_id()), 
        if( 
          row_id() < 100, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ), 
    "" 
  ) 
)
